import React from "react";
import "./quote.styles.css";

export const Quote = () => {
  const quoteFetch = async () => {
    const quote = await fetch("https://restcountries.com/v3.1/name/peru", {
      mode: "no-cors",
    });
    const dataOne = quote.json();
    console.log(dataOne);
  };
  return (
    <div className="quote-container">
      <button onClick={quoteFetch}>GET QUOTE!</button>
      <h2 className="header-cont">QUOTE OF THE DAY</h2>
      <h2>QUOTE:</h2>
    </div>
  );
};
